                "rule": "js:\n$.exports.range = function(m, n) {\n    return Math.floor(Math.random() * (m - n + 1) + n);\n}\n$.exports.color = function(text, color) {\n    text += \"\";\n    if (text.indexOf(\"““””\") === 0) {\n        text.replace(\"““””\", \"\");\n    }\n    return \"““””<font color='\" + color + \"'>\" + text + \"</font>\";\n}\nfunction htmlTag(tag, text) {\n    text += \"\";\n    if (text.indexOf(\"““””\") === 0) {\n        text.replace(\"““””\", \"\");\n    }\n    return \"““””\" + \"<\" + tag + \">\" + text + \"</\" + tag + \">\";\n\n}\n\nfunction getNowFormatDate() {\n            let date = new Date();\n            let seperator1 = \"-\";\n            let seperator2 = \":\";\n            let month = date.getMonth() + 1;\n            let strDate = date.getDate();\n            let strHours = date.getHours();\n            let strMinutes = date.getMinutes();\n            let strSeconds = date.getSeconds()+1;\n            if (month >= 1 && month <= 9) {\n                month = \"0\" + month\n            }\n            if (strDate >= 0 && strDate <= 9) {\n                strDate = \"0\" + strDate\n            }\n            if (strHours >= 0 && strHours <= 9) {\n                strHours = \"0\" + strHours\n            }\n            if (strMinutes >= 0 && strMinutes <= 9) {\n                strMinutes = \"0\" + strMinutes\n            }\n            if (strSeconds >= 0 && strSeconds <= 9) {\n                strSeconds = \"0\" + strSeconds\n            }\n            //let currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate + \" \" + strHours + seperator2 + strMinutes + seperator2 + strSeconds;\n            let currentdate = (date.getFullYear()-2020)+''+ month +''+ strDate +''+ strHours+'' + strMinutes +''+ Math.ceil(strSeconds/7);\n            return parseInt(currentdate)\n        }\n$.exports.getNowFormatDate = getNowFormatDate;\n$.exports.htmlTag = htmlTag;\n$.exports.small = function(text) {\n    return htmlTag(\"small\", text);\n}\n$.exports.unique2 = function unique2(array){\n    return Array.from(new Set(array));\n}\n$.exports.strDeal = function strDeal(str){\n    str = str.split('');\n    str = str.filter(e => (e >= 0 && e <= 9) || (e >= 'a' && e <= 'z') || (e >= 'A' && e <= 'Z') || (e >= '\\u4e00' && e <= '\\u9fa5'));\n    str = str.join('');\n    return str\n}"
