                "rule": "$.exports = function(showAll) {\n    let url = getMyVar('remoteUrl'),\n        data = []\n    if (url.startsWith('hiker://') || url.startsWith('file://')) {\n        // 如果为本地文件则不进行缓存\n        try {\n            let oriData = fetch(url)\n            if (url.startsWith('hiker://page/'))\n                oriData = JSON.parse(oriData).rule\n            data = JSON.parse(oriData)\n        } catch (e) {}\n    } else {\n        // 获取远程数据，检查间隔默认一天\n        let interval = parseInt(readFile('updateInterval') || '1'),\n            oldData = fetch('hiker://files/libs/' + md5(url) + '.js'),\n            remoteData = []\n        try { remoteData = JSON.parse(fetchCache(url, 24 * interval, {timeout:50000})) } catch(e) {}\n        if(!Array.isArray(remoteData)) remoteData = []\n        if (remoteData.length < 3) {\n            log('未获取到数据')\n            if (oldData) writeFile('hiker://files/libs/' + md5(url) + '.js', oldData)\n            data = JSON.parse(oldData || '[]')\n        } else {\n            log('已获取到数据')\n            data = remoteData\n        }\n    }\n    data = data.filter((v) => { return v.title != getMyVar('myCollection') && !(v.author || '').includes('轻合集生成器') })\n    if (readFile('disableCustom')) return data\n    else { // 写入自定义数据\n        let customData = JSON.parse(readFile('customData') || '[]'),\n            rewriteData = []\n        customData = customData.reduce((self, v) => {\n            let index = data.findIndex((vv) => v.title == vv.title)\n            if (index >= 0) {\n                self.push(v)\n                let rule = data.splice(index, 1)[0]\n                if (showAll || v.visible)\n                    rewriteData.push(Object.assign(rule, v))\n            }\n            return self\n        }, [])\n        data.forEach((v) => customData.push({ title: v.title, visible: true }))\n        saveFile('customData', JSON.stringify(customData))\n        return rewriteData.concat(data)\n    }\n}\n"
