                "rule": "// 首页链接替换分类\nfunction indexUrl(param) {\n    function runCode(rule) {\n        try {\n            let [input, code] = rule.split('.js:')\n            return code ? eval(code) : rule\n        } catch (e) { return rule }\n    }\n    let { RULE, pageNum, QING_TITLE } = JSON.parse(param.split('###')[1])\n    RULE = JSON.parse(base64Decode(RULE))\n    pageNum = parseInt(pageNum)\n    let url = RULE.url\n\n    eval(JSON.parse(fetch('hiker://page/ClassTab?rule=' + QING_TITLE)).rule)\n    url = tabHeader.setUrl(fyAll ? url.replace(/fyAll/g, '$${fyAll}') : url.replace(/fy(class|area|year|sort)/g, '$${fy$1}'))\n    url = url.replace(/fypage(?:@(-?\\d+)@)?(?:\\*(\\d+)@)?/g, (_, start, space) => parseInt(start || 0) + 1 + (pageNum - 1) * parseInt(space || 1))\n    url = /^([\\s\\S]*?)(?:\\[firstPage=([\\s\\S]*?)\\])?(?:(\\.js:[\\s\\S]*?))?$/.exec(url)\n    if (pageNum == 1 && url[2]) url[1] = url[2]\n    if (url[3] && !url[1].includes('.js:')) url[1] += url[3]\n    return runCode(url[1])\n}\n// 链接参数处理\nfunction paramHandle(urlParam, ua, urlTmp) {\n    let charset, UserAgent\n    try { // 链接的编码和ua应该是首先继承首页链接\n        [, , charset, UserAgent] = urlTmp.split(';')\n        UserAgent = UserAgent.match(/^{(.*)}$/)[1].split('&&').find((v) => v.startsWith('User-Agent@'))\n    } catch (e) {}\n    urlParam[0] = urlParam[0] || 'GET'\n    urlParam[1] = urlParam[1] || charset || 'UTF-8'\n    try {\n        urlParam[2] = urlParam[2].match(/^{(.*)}$/)[1].split('&&')\n    } catch (e) { urlParam[2] = [] }\n    // 添加全局UA\n    if (!urlParam[2].some((v) => v.startsWith('User-Agent@'))) {\n        if (UserAgent) urlParam[2].push(UserAgent)\n        else if (ua == 'pc')\n            urlParam[2].push('User-Agent@' + PC_UA.replace(/;/g, '；；').replace(/\\?/, '？？'))\n        else if (ua == 'mobile')\n            urlParam[2].push('User-Agent@' + MOBILE_UA.replace(/;/g, '；；').replace(/\\?/, '？？'))\n    }\n    urlParam[2] = '{' + urlParam[2].join('&&') + '}'\n    return urlParam.join(';')\n}\n"
