        "find_rule": "js:\n/**\nhttps://www.sksgk.top/index.php/vod/show/id/1/page/%%fypage%%.html\nhttps://123kubo.tv/show/fyclass/fyarea/fyyear/fysort/page/fypage.html\n**/\nlet d = [];\n/*变量 最好更改\n ****123kubo.url\n ****123kubo.fl\n ****123kubo.classify\n *\n *需修改\n ****翻页  true_url\n ****列表 fl classify\n ****分类  sub_classify\n */\n//自定义颜色\nconst Color = \"#FA7298\";\n\n//a 猜测首页url\nconst page = MY_URL.match(/%%(.*)%%/)[1];\nvar a = MY_URL.replace(/%%/g, \"\");\na = a.replace(page+'.html', '.html');\nlet true_url = getVar(\"123kubo.url\", a);\n\n//setError(page);\n\n//翻页 根据实际替换\ntrue_url = true_url.replace('.html', '/page/' + page + '.html').replace('type', 'show');\n\n//setError(true_url);  \nconst html = fetch(true_url)\n// const empty = \"hiker://empty\"\n//获取列表 \nconst fl = parseDomForArray(html, '.hl-nav&&ul'); //四大金刚(电影，综艺，动漫，剧集)\nconst classify = parseDomForArray(html, '.hl-filter-all&&.hl-filter-list'); //其他分类列表\n\n\n\nlet init_cate = []\nfor (let i = 0; i < 20; i++) {\n    init_cate.push(\"0\")\n}\n\n// 取四金刚缓存\n\nconst cate_temp_json = getVar(\"123kubo.fl\", JSON.stringify(init_cate))\nconst cate_temp = JSON.parse(cate_temp_json)\n\n// 取其他分类列表缓存\n\nconst classify_json = getVar(\"123kubo.classify\", JSON.stringify(init_cate))\nconst classify_temp = JSON.parse(classify_json)\n/**d.push({\n                title:true_url,\ncol_type:'text_1'\n});**/\nif (parseInt(page) === 1) {\n    fl.forEach((category, index) => {\n        //四大金刚的分类\t\n        let sub_classify = parseDomForArray(category, 'ul&&li:not(:contains(首页))'); ////需修改\n        sub_classify.forEach((item, key) => {\n            let title = parseDomForHtml(item, 'a&&Text')\n            d.push({\n                title: key.toString() === cate_temp[index] ? '““””<b><font color=' + Color + '>' + title + ' </font></b>' : title,\n                url: $(parseDom(item, 'a&&href')).lazyRule((params) => {\n                    params.cate_temp[params.index] = params.key.toString()\n                    putVar(\"123kubo.fl\", JSON.stringify(params.cate_temp))\n                    putVar(\"123kubo.url\", input)\n                    refreshPage(true)\n                    return \"hiker://empty\"\n                }, {\n                    cate_temp: cate_temp,\n                    index: index,\n                    key: key,\n                    page: page,\n                }),\n                col_type: 'scroll_button',\n            })\n        })\n        d.push({\n            col_type: \"blank_block\"\n        });\n    })\n\n\n    //其他分类\n    classify.forEach((category, index) => {\n        let sub_classify = parseDomForArray(category, 'ul&&li:has(a)'); ////需修改\n        sub_classify.forEach((item, key) => {\n            let title = parseDomForHtml(item, 'a&&Text')\n            if (title !== '') {\n                d.push({\n                    title: key.toString() === classify_temp[index] ? '““””<b><font color=' + Color + '>' + title + ' </font></b>' : title,\n                    url: $(parseDom(item, 'a&&href')).lazyRule((params) => {\n                        params.classify_temp[params.index] = params.key.toString()\n                        putVar(\"123kubo.classify\", JSON.stringify(params.classify_temp))\n                        putVar(\"123kubo.url\", input)\n                        refreshPage(true)\n                        return \"hiker://empty\"\n                    }, {\n                        classify_temp: classify_temp,\n                        index: index,\n                        key: key,\n                        page: page,\n                    }),\n                    col_type: 'scroll_button',\n                })\n            }\n        })\n        d.push({\n            col_type: \"blank_block\"\n        });\n    })\n\n\n\n\n}\n\n\n\n//一级页面\nvar list = parseDomForArray(html, 'body&&.hl-list-item');\n//setError(list)\nfor (var j in list) {\n    d.push({\n        title: parseDomForHtml(list[j], '.hl-item-thumb&&title'),\n        pic_url: parseDom(list[j], '.hl-item-thumb&&data-original'),\n        desc: parseDomForHtml(list[j], '.hl-pic-tag&&Text') + parseDomForHtml(list[j], '.hl-lc-1&&Text') + parseDomForHtml(list[j], '.score&&Text'),\n\n        url: parseDom(list[j], '.hl-item-thumb&&href')+\"#immersiveTheme#\"\n    })\n}\n\nsetResult(d);",
