                "rule": "function getAddressTag(url, text) {\n    return '<a href=\"' + url + '\">' + text + '</a>'\n}\n\nfunction getRangeColors(){\n    //颜色 代码来自Rx大佬\n    let Colors=[\"4\",\"5\",\"0\",\"1\",\"A\",\"3\",\"8\",\"9\",\"B\",\"C\",\"D\",\"E\",\"6\",\"7\",\"F\"];\n    let Color = \"#\";\n    for (let i=0;i<6;i++){\n        let num=Math.ceil((Math.random()*15))-1;\n        Color+=Colors[num];\n    }\n    return Color;\n}\n\nfunction getBaiduYunCode(content){\n    if(content.includes(\"pan.baidu.com\")){\n        var code = content.split(\"提取码：\");\n        if(code.length>1) copy(code[1].substring(0,4));\n    }\n}"
