                "rule": "function getItem(html,colors){\n    var list = parseDomForArray(html, '.content&&article');//       【列表】\n    var item=[];\n    for (var i in list) {\n        let title = parseDomForHtml(list[i], 'h2&&Text');\n        let pic = \"https://img0.baidu.com/it/u=1420719556,2509925486&fm=26&fmt=auto&gp=0.jpg\";\n        try{\n            pic = parseDomForHtml(list[i], '.thumb&&data-original');\n        }catch(e){}\n        let commentNum = '0';\n        try{\n            commentNum = parseDomForHtml(list[i], '.post-comments&&Text').split(\"(\")[1].split(\")\")[0];\n        }catch(e){}\n\n        let time = \"🕧日期: \" + '““””<b><font color='+ colors + '>' + parseDomForHtml(list[i], '.text-muted.time--a&&Text').replace(\"发布于\",\"\") +' </font></b>';\n        let like = \"💜点赞: \" + '““””<b><font color='+ colors + '>' + parseDomForHtml(list[i], '.text-muted.views&&a,0&&span&&Text') +' </font>&nbsp;&nbsp;</b>';\n        let comment =  \"  💬评论: \" + '““””<b><font color='+ colors + '>' + commentNum +' </font></b>';\n\n        let tabs=\"\\n\\n\";\n\n        item.push({\n            title:title,//【标题】\n            pic_url: pic, //图片\n            desc: time+tabs+like+comment,//【描述】\n            url: parseDom(list[i], 'h2&&a&&href') +'#noRecordHistory##noHistory#',//【链接】\n        });\n    }\n    return item;\n}\n\nfunction getSearchItem(html){\n    var list = parseDomForArray(html, '.content&&article');//       【列表】\n    var item=[];\n    for (var i in list) {\n        let title = parseDomForHtml(list[i], 'h2&&Text');\n        let pic = \"https://img0.baidu.com/it/u=1420719556,2509925486&fm=26&fmt=auto&gp=0.jpg\";\n        try{\n            pic = parseDomForHtml(list[i], '.thumb&&data-original');\n        }catch(e){}\n        let commentNum = '0';\n        try{\n            commentNum = parseDomForHtml(list[i], '.post-comments&&Text').replace(/评论(|)/g,'');\n        }catch(e){}\n\n        // let time = \"🕧: \" + parseDomForHtml(list[i], '.text-muted.time--a&&Text').replace(\"发布于\",\"\");\n        let like = \"💜: \" + parseDomForHtml(list[i], '.text-muted.views&&a,0&&span&&Text');\n        let comment =  \"💬: \" + commentNum;\n\n        let tabs=\"   \";\n        \n        item.push({\n            title:title,//【标题】\n            pic_url: pic, //图片\n            desc: like+tabs+comment,//【描述】\n            url: parseDom(list[i], 'h2&&a&&href') +'#noRecordHistory##noHistory#',//【链接】\n        });\n    }\n    return item;\n}"
