                "rule": "js:\nvar d = [];\ntry {\n    var fm = set_switch\n} catch (e) {\n    fm = MY_URL\n}\nconst page = fm.split('##')[1];\nif(page ==1){\n  fm =fm.replace('##1','');\n}else{\n  fm =fm.replace('##'+page,'');\n  fm+='index_'+page+'.html';\n}\n\n   \n     html = fetch(fm, {});\nif(page ==1){\nconst subscription = pdfh(html, '.right-user&&Html');\nvar lb = fetch(\"hiker://files/游侠网/我的大鱼号.txt\", {});\nvar q = pdfh(subscription, 'img&&alt');\nvar vpd = lb.includes(q);\nvar info = q + '&&' + parseDom(subscription, 'a&&href') + '&&' + pdfh(subscription, 'img&&src');\nvar la = vpd ? getVar('ali_subscribea2') : getVar('ali_subscribea1');\n// d.push();\nd.push({\n    title: pdfh(subscription, 'img&&alt'),\n    url: 'hiker://page/list?url=' + pd(subscription, 'a&&href')+'##fypage',\n    pic_url: pdfh(subscription, 'img&&src'),\n    col_type: 'icon_2_round'\n}, {\n    title: (vpd ? '‘‘取消订阅’’' : '““+订阅””'),\n    url: 'hiker://empty#' + info + la,\n    col_type: 'text_2'\n}, {\n    title: pdfh(subscription, '.user-title&&Text') + '<small>' + pdfh(subscription,'.subscribe-view&&Text') + '</small>',\n    col_type: 'rich_text'\n});\n\n}\nvar list = pdfa(html, 'body&&.subscribe-list&&.subscribe-li');\n    for (var j in list) {\n        let title = pdfh(list[j], '.a-title&&Text');\n        let desc = '<small>' + pdfh(list[j], '.subscribe-info&&Text') + '\\n' + ' </small>““””<small><font color=\"red\">' + pdfh(list[j], 'p&&Text') + '</font></small>';\n        let img = pd(list[j], 'img&&src');\n        let url =  'hiker://page/detail?url=' +pd(list[j], 'a&&href') ;\n        d.push({\n            title: title,\n            desc: desc,\n            img: img,\n            url: url\n        });\n    }\n\nsetResult(d);"
