        "find_rule": "js:\nlet d = [];\n/*变量 最好更改\n ****3dmgameoriginal.url\n ****3dmgameoriginal.fl\n ****3dmgameoriginal.classify\n *\n *需修改\n ****翻页  true_url\n ****列表 fl classify\n ****分类  sub_classify\n */\n//自定义颜色\nconst Color = \"blue\";\n\n//a 猜测首页url\nconst page = MY_URL.match(/%%(.*)%%/)[1];\nvar a = MY_URL.replace(/%%/g, \"\");\na = a.replace('/' + page, '/');\nlet true_url = getVar(\"3dmgameoriginal.url\", a);\n\n//setError(page);\n\n\n//翻页 根据实际替换\n\nif (page != 1) {\n    if (true_url.indexOf('_1') == -1) {\n        if (true_url.search(/(original\\/+$)/) != -1) {\n            true_url = true_url.replace(/(\\/+$)/, '_all_' + page + '/');\n        } else {\n            true_url = true_url.replace(/(\\/+$)/, '_' + page + '/');\n        }\n    } else {\n        true_url = true_url.replace('_1', '_' + page);\n    }\n}\n\n\n\n//setError(true_url);  \nconst html = fetch(true_url)\n// const empty = \"hiker://empty\"\n//获取列表 \nconst fl = parseDomForArray(html, '.content&&.top_nav'); //四大金刚(电影，综艺，动漫，剧集)\nconst classify = parseDomForArray(html, '.show_&&.clear'); //其他分类列表\n//setError(classify)\n\n\nlet init_cate = []\nfor (let i = 0; i < 20; i++) {\n    init_cate.push(\"0\")\n}\n\nconst cate_temp_json = getVar(\"3dmgameoriginal.fl\", JSON.stringify(init_cate))\nconst cate_temp = JSON.parse(cate_temp_json)\n\n// 取其他分类列表缓存\n\nconst classify_json = getVar(\"3dmgameoriginal.classify\", JSON.stringify(init_cate))\nconst classify_temp = JSON.parse(classify_json)\n/**d.push({\n                title:true_url,\ncol_type:'text_1'\n});**/\nvar tt = 0;\n\nif (parseInt(page) === 1) {\n    fl.forEach((category, index) => {\n        //四大金刚的分类\t\n        let sub_classify = parseDomForArray(category, '.top_nav&&a:not(:contains(首页))'); ////需修改\n        sub_classify.forEach((item, key) => {\n            let title = parseDomForHtml(item, 'a&&Text');\n            tt = cate_temp[index]\n            d.push({\n                title: key.toString() === cate_temp[index] ? '““””<b><font color=' + Color + '>' + title + ' </font></b>' : title,\n                url: $(parseDom(item, 'a&&href').replace('#newsnav', '')).lazyRule((params) => {\n                    params.cate_temp[params.index] = params.key.toString()\n                    putVar(\"3dmgameoriginal.fl\", JSON.stringify(params.cate_temp))\n                    putVar(\"3dmgameoriginal.url\", input)\n                    refreshPage(true)\n                    return \"hiker://empty\"\n                }, {\n                    cate_temp: cate_temp,\n                    index: index,\n                    key: key,\n                    page: page,\n                }),\n                col_type: 'scroll_button',\n            })\n        })\n        d.push({\n            col_type: \"blank_block\"\n        });\n    })\n    classifys = new Array(1);\n    classifys[0] = classify[tt];\n    //其他分类\n    classifys.forEach((category, index) => {\n        let sub_classify = parseDomForArray(category, '.clear&&a'); ////需修改\n        sub_classify.forEach((item, key) => {\n            let title = parseDomForHtml(item, 'a&&Text')\n            if (title !== '') {\n                d.push({\n                    title: key.toString() === classify_temp[index] ? '““””<b><font color=' + Color + '>' + title + ' </font></b>' : title,\n                    url: $(parseDom(item, 'a&&href').replace('#newsnav', '')).lazyRule((params) => {\n                        params.classify_temp[params.index] = params.key.toString()\n                        putVar(\"3dmgameoriginal.classify\", JSON.stringify(params.classify_temp))\n                        putVar(\"3dmgameoriginal.url\", input)\n                        refreshPage(true)\n                        return \"hiker://empty\"\n                    }, {\n                        classify_temp: classify_temp,\n                        index: index,\n                        key: key,\n                        page: page,\n                    }),\n                    col_type: 'scroll_button',\n                })\n            }\n        })\n        d.push({\n            col_type: \"blank_block\"\n        });\n    })\n\n\n\n\n}\n\n//一级页面\nvar list = parseDomForArray(html,'.yc_warp_list&&ul&&li');\n\n//setError(list)\nfor (var j in list) {\n    d.push({\n        title: parseDomForHtml(list[j], '.bt&&Text'),\n        pic_url: parseDom(list[j], 'img&&data-original'),\n        desc: parseDomForHtml(list[j], '.time&&Text') + '\\n' + parseDomForHtml(list[j], '.a&&Text'),\n\n        url: parseDom(list[j], 'a&&href')\n    })\n}\n\nsetResult(d);",
