                "rule": "const ClassTab = function(classArray, params) {\n    Object.assign(this, params)\n    this.arr = classArray.map(v => this.init(v))\n    this.sign = '$' + QING_TITLE + '_' + (this.name || '') + '_'\n    this.color = this.color || '#12b668'\n    this.boundary = this.boundary || 'blank_block'\n}\nClassTab.prototype = {\n    constructor: ClassTab,\n    load(el) {\n        let folded = this.fold && getVar('fold_' + this.sign, '')\n        if (this.arr.length > 1 && this.fold) el.push({\n            title: '““””' + (folded ? '▶' : '▼').fontcolor('#049eff'),\n            url: $('#noLoading#').lazyRule((sign, folded) => {\n                putVar('fold_' + sign, { '': 'T', 'T': '' } [folded])\n                refreshPage(false)\n                return 'hiker://empty'\n            }, this.sign, folded),\n            col_type: 'scroll_button'\n        })\n        let arr = folded ? [this.arr[0]] : this.arr\n        arr.forEach((v) => {\n            let { id, class_name, class_url } = v,\n            selected = JSON.stringify(this.getClass(id))\n            class_name.forEach((name, i) => {\n                let url = class_url[i],\n                    now = JSON.stringify({ name: name, url: url })\n                el.push({\n                    title: selected == now ? '““””' + name.fontcolor(this.color).bold() : name,\n                    url: selected == now ? 'hiker://empty' : $('#noLoading#').lazyRule((sign, id, now) => {\n                        putVar(sign + id, now)\n                        refreshPage(false)\n                        return 'hiker://empty'\n                    }, this.sign, id, now),\n                    col_type: 'scroll_button'\n                })\n            })\n            el.push({ col_type: this.boundary })\n        })\n    },\n    init(classObject) {\n        if (typeof classObject.class_name == 'string')\n            classObject.class_name = classObject.class_name.split('&')\n        if (typeof classObject.class_url == 'string')\n            classObject.class_url = classObject.class_url.split('&').map((v) => v.trim())\n        return classObject\n    },\n    push(classObject) {\n        this.arr.push(this.init(classObject))\n    },\n    getClass(id) {\n        let defaultClass = this.arr.find(item => item.id == id)\n        if (defaultClass) defaultClass = JSON.stringify({\n            name: defaultClass.class_name[0],\n            url: defaultClass.class_url[0]\n        })\n        else throw new Error('cannot find id: ' + id + ' in classTab: ' + this.sign)\n        return JSON.parse(getVar(this.sign + id, defaultClass))\n    },\n    setUrl(url) {\n        return url.replace(/\\$\\{([^}]*)\\}/g, (_, id) => this.getClass(id).url)\n    }\n}\n// 生成头部分类\nconst fyAll = RULE.url.includes('fyAll')\nlet tabHeader = []\nif (RULE.class_name) tabHeader.push({\n    id: fyAll ? 'fyAll' : 'fyclass',\n    class_name: RULE.class_name,\n    class_url: RULE.class_url\n})\nif (RULE.area_name) tabHeader.push({\n    id: fyAll ? 'fyAll' : 'fyarea',\n    class_name: RULE.area_name,\n    class_url: RULE.area_url\n})\nif (RULE.year_name) tabHeader.push({\n    id: fyAll ? 'fyAll' : 'fyyear',\n    class_name: RULE.year_name,\n    class_url: RULE.year_url\n})\nif (RULE.sort_name) tabHeader.push({\n    id: fyAll ? 'fyAll' : 'fysort',\n    class_name: RULE.sort_name,\n    class_url: RULE.sort_url\n})\ntabHeader = new ClassTab(tabHeader, { name: RULE.title, fold: readFile('tabFold'), })\n"
